    {
				MessageBox.Show("A Component in the BOM does not exist in the Parts Master table, or the record has been made inactive. Please contact the Operations department to resolve this issue.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
				PageLeaveFunctions.SetNextInputPage(1);
				Args.Cancel = true;

    }

    /* Smart Code Generation */
    string coretype = "";
    string prodgroup = "";

    coretype = "";
    prodgroup = "";

    if (Inputs.cmb_coresolution.Value == "Core") { coretype = "COR"; }
    if (Inputs.cmb_coresolution.Value == "Solution") { coretype = "SOL"; }

    if (Inputs.cmb_productgroup.Value == "InQueue Merchandising.") { prodgroup = "IQM"; }

    /* Finds sector Smart Code */
    Inputs.var_sectorcode.Value = PCLookUp.DataLookup("Sectors", "sector_code", Inputs.cmb_sector.Value);

    string sumsalescat = "";

    sumsalescat = "";

    if (Inputs.cmb_sumsalescat.Value == "Core") { sumsalescat = "COR"; }
    if (Inputs.cmb_sumsalescat.Value == "Solution") { sumsalescat = "SOL"; }

    Inputs.var_smartstring.Value = sumsalescat + "|" + coretype + "-" + prodgroup + "|" + Inputs.var_fgnum.Value + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + Inputs.var_sectorcode.Value;

    Inputs.var_smart1.Value = coretype + "-" + prodgroup;
    Inputs.var_smart2.Value = Inputs.var_fgnum.Value;
    Inputs.var_smart3.Value = Inputs.var_sectorcode.Value;

    /* Validity Routines */

    /* Checks if FG Number passed to sales line is less than 50 Characters */
    decimal smartcount = 0m;
    smartcount = 0;
    smartcount = Inputs.var_smart2.Value.Length;
    if (smartcount > 50)
    {
				MessageBox.Show("The Finished Goods Number exceeds the Maximum number of Characters allowed in the Sales Line Part Number Field......", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
				PageLeaveFunctions.SetNextInputPage(1);
				Args.Cancel = true;
    }

    /* Checks if fg description has been passed */
    string fgdesccheck = "";
    string fgdesc2 = "";
    fgdesccheck = Inputs.var_fgdesc.Value;
    fgdesc2 = "";
    if (fgdesccheck == "")
    {
				available_part = UDMethods.GetPartDescription(Context.CompanyID, Inputs.var_fgnum.Value, out fgdesc2);

 			if (fgdesc2 != "")
				{
					Inputs.var_fgdesc.Value = fgdesc2;
  				Inputs.var_fgvalidity.Value = "OK";
				}
				if (fgdesc2 == "")
				{
					MessageBox.Show("No Description has been returned for the Finished Goods Number.........", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
					PageLeaveFunctions.SetNextInputPage(1);
					Args.Cancel = true;
				}
    }

   /* Comment Strings */

   string recoildesc = "";
   recoildesc = "";

   if (Inputs.var_part1.Value != "")
   {
       available_part = UDMethods.GetPartDescription(Context.CompanyID, Inputs.var_part1.Value, out recoildesc);

   }

   if ((Inputs.var_part2.Value != "") || (Inputs.var_part3.Value != "") || (Inputs.var_part4.Value != ""))
   {
       Inputs.var_jobcomment.Value = recoildesc + " with Adhesive Pads Applied.";
   }

   if ((Inputs.var_part2.Value == "") && (Inputs.var_part3.Value == "") && (Inputs.var_part4.Value == ""))
   {
       Inputs.var_jobcomment.Value = recoildesc + ".";
   }

   if (Inputs.var_jobcomment.Value == "") { Inputs.var_linecomment.Value = ""; }
   if (Inputs.var_jobcomment.Value != "") { Inputs.var_linecomment.Value = Inputs.var_jobcomment.Value; }

   /* Calculates Net Weight */

   decimal CompWeight1 = 0m;
   decimal CompWeight2 = 0m;
   decimal CompWeight3 = 0m;
   decimal CompWeight4 = 0m;
   decimal CompWeight5 = 0m;

	Decimal partWeight = 0.0m;

	/* CompWeight1 */
  if (Inputs.var_part1.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part1.Value);
  }

  if (available_part)
  {

      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part1.Value, out partWeight);
      CompWeight1 = partWeight * Inputs.var_partqty1.Value;
  }

	/* CompWeight2 */
  if (Inputs.var_part2.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part2.Value);
  }

  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part2.Value, out partWeight);
      CompWeight2 = partWeight * Inputs.var_partqty2.Value;
  }

	/* CompWeight3 */
  if (Inputs.var_part3.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part3.Value);
  }

  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part3.Value, out partWeight);
      CompWeight3 = partWeight * Inputs.var_partqty3.Value;
  }

	/* CompWeight4 */
  if (Inputs.var_part4.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part4.Value);
  }

  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part4.Value, out partWeight);
      CompWeight4 = partWeight * Inputs.var_partqty4.Value;
  }

	/* CompWeight5 */
  if (Inputs.var_part5.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part5.Value);
  }

  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part5.Value, out partWeight);
      CompWeight5 = partWeight * Inputs.var_partqty5.Value;
  }

  /* Totals the individual component weights */
  Inputs.var_netweight.Value = CompWeight1 + CompWeight2 + CompWeight3 + CompWeight4 + CompWeight5;

  /* Used to display Netweight list incase verification is required */
  Inputs.var_weightlookup.Value = "1(" + CompWeight1.ToString() + ")" + " - 2(" + CompWeight2.ToString() + ")" + " - 3(" + CompWeight3.ToString() + ")" + " - 4(" + CompWeight4.ToString() + ")" + " - 5(" + CompWeight5.ToString() + ")";

  /* Returns Commodity Code from CSV */
  Inputs.var_commodity.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", "commodity_code", Inputs.var_fgnum.Value);

   /* If no commodity code is returned from the CSV file it checks the parts master table */
   string partclass = "";
   partclass = "";
   if (Inputs.var_commodity.Value == "")
   {
		 available_part = UDMethods.GetPartClass(Context.CompanyID, Inputs.var_fgnum.Value, out partclass);

   }


   /* As Part Class is used to assign Commodity Code */
 	string partClassCommodityCode = "";
   if ((Inputs.var_commodity.Value == "") && (partclass != ""))
   {
		 bool available_partclass = UDMethods.GetPartClassCommodity(Context.CompanyID, partclass, out partClassCommodityCode);

		if (available_partclass) {
			Inputs.var_commodity.Value = partClassCommodityCode;
		}
   }



   /* Verifies Commodity code exists in IComCode Table within Epicor */
   string commoditycheck = "";
   commoditycheck = "";
		if (Inputs.var_commodity.Value != "")
		{
			bool available_ICommCode = UDMethods.GetICommImportCode(Context.CompanyID, Inputs.var_commodity.Value, out commoditycheck);
		}

  if (Inputs.var_commodity.Value != commoditycheck)
  {
				MessageBox.Show("The Configurator has assigned a Commodity code that does not have a corresponding Epicor record, please contact the Operations department to correct this error.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
				PageLeaveFunctions.SetNextInputPage(1);
				Args.Cancel = true;
  }

  if (Inputs.var_commodity.Value == "")
  {
			MessageBox.Show("The Configurator has been unable to determine the Commodity Code for the chosen configuration. Please contact the Operations department.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
			PageLeaveFunctions.SetNextInputPage(1);
			Args.Cancel = true;

  }
  else if ((Inputs.var_commodity.Value != "") || (Inputs.var_commodity.Value == commoditycheck))
  {
      PageLeaveFunctions.SetNextInputPage(4);
  }

  /* ********************************************************************************************************************************************************************************** */

  /* Pack Comment */

  string Mode = "";
  int CustID = 0;
  int OrderNum = 0;
  int QuoteNum = 0;
  string CustCountry = "";
  string CustName = "";
  string OTSID = "";
  bool OTS = false;
  int OTSCountry = 0;

  /* Determines Current Configuration Mode and order/quote specifics */
  Mode = Context.Entity;
  CustID = 0; /* Set to Zero when not used for testing*/
  CustCountry = "";
  OrderNum = Context.OrderNumber;
  QuoteNum = Context.QuoteNumber;

  /* ********************************************************************************************************************************************************************************** */
  if (Mode == "Quote")
  {

	/* Retrieve details from Quote Header */
      bool available_QuoteHed = UDMethods.GetQuoteHed(Context.CompanyID, QuoteNum, out CustID, out OTSID, out OTS);

      if (available_QuoteHed)
      {
		Inputs.var_custid.Value = CustID;
      }

      /* Retrieves customer name using customer ID */
      bool available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry); 

	/* ************************************************************** */

	/* If a saved shipto address is specified gets country info */
      if (OTSID != "")
      {

          bool available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
          bool available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);

      }

	Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + QuoteNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
	Inputs.var_shipcountry.Value = CustCountry;
  }

    /* ********************************************************************************************************************************************************************************** */
    if (Mode == "Order")
    {
			/* Retrieve details from Order Header */
        bool available_OrderHed = UDMethods.GetOrderHed(Context.CompanyID, OrderNum, out CustID, out OTSID, out OTS);

        if (available_OrderHed)
        {
				Inputs.var_custid.Value = CustID;
        }

        /* Retrieves customer name using customer ID */
        bool available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry); 

 				/* ************************************************************** */

        /* If a saved shipto address is specified gets country info */
        if (OTSID != "")
        {

            bool available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
					bool available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);

        }

		 Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + OrderNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
		 Inputs.var_shipcountry.Value = CustCountry;

	}

  /* ********************************************************************************************************************************************************************************** */
  if (Mode == "PcStatus")
  {

      Inputs.var_orderdtl.Value = "Mode: " + Mode;
      /* Inputs.var_shipcountry.Value = "Albania". */

      Inputs.var_custid.Value = 11131;

  }

  string palletlookup = "";

  palletlookup = "";

  /* Finds Pallet lookup from csv based on Shipping country*/
  palletlookup = PCLookUp.DataLookup("CountryPalletList", "pallet_type", Inputs.var_shipcountry.Value);

  if (palletlookup != "")
  {
      Inputs.var_palletlookup.Value = palletlookup + "_Lookup";
      Inputs.var_packcomment.Value = PCLookUp.DataLookup("CountryPalletList", "default_message", Inputs.var_shipcountry.Value);
  }

  if (palletlookup == "") { Inputs.var_palletlookup.Value = "All_Lookup"; }

}

/* ********************************************************************************************************************************************************************************** */

/* Determine the pick operation cycle time based on FG Number */


/* Find pick cycle_time_selector */
string pickcycletimelookup = "";
pickcycletimelookup = "pick";


/* Returns cycletime from Master FG List CSV */

string pickcycletimeselector = "";

pickcycletimeselector = pickcycletimelookup + "_op_time_min";

Inputs.var_op10time.Value = UDMethods.ConvertToDecimal(PCLookUp.DataLookup("TENUK_FG_MasterTable", pickcycletimeselector, Inputs.var_fgnum.Value));

/* ********************************************************************************************************************************************************************************** */

/* Find cass cycle_time_selector */
string casscycletimelookup = "";
casscycletimelookup = "std";


/* Returns cycletime from Master FG List CSV */

string casscycletimeselector = "";

casscycletimeselector = casscycletimelookup + "_op_time_min";

Inputs.var_op20time.Value = UDMethods.ConvertToDecimal(PCLookUp.DataLookup("TENUK_FG_MasterTable", casscycletimeselector, Inputs.var_fgnum.Value));
